import React from 'react';

export default class Title extends React.Component{
    render(){
      return(
        <div>
         <p> Леша</p>
         <p> Миша</p>
         <p> Гена</p>
         <p> Паша</p>
         <p> Маша</p>
        </div>
      )
    }
  }
